import 'package:time_tracking_dashboard/data/models/period_model.dart';import 'package:time_tracking_dashboard/domain/entities/time_fram_entity.dart';class TimeFrameModel extends TimeFrameEntity {  PeriodModel? daily;  PeriodModel? monthly;  PeriodModel? weekly;  TimeFrameModel({this.daily, this.monthly, this.weekly})      : super(dailyPeriod: daily, monthlyPeriod: monthly, weeklyPeriod: weekly);  factory TimeFrameModel.fromJson(Map<String, dynamic> json) {    return TimeFrameModel(      daily: json['daily'] != null ? PeriodModel.fromJson(json['daily']) : null,      monthly: json['monthly'] != null          ? PeriodModel.fromJson(json['monthly'])          : null,      weekly:          json['weekly'] != null ? PeriodModel.fromJson(json['weekly']) : null,    );  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = <String, dynamic>{};    if (daily != null) {      data['daily'] = daily!.toJson();    }    if (monthly != null) {      data['monthly'] = monthly!.toJson();    }    if (weekly != null) {      data['weekly'] = weekly!.toJson();    }    return data;  }}